  true,\n\t\"url\": null,\n\t\"notes\": \"The National Longitudinal Study of the High
  School Class of 1972 (NLS-72) is part of the Secondary Longitudinal Studies (SLS)
  program; program data is available since 1972 at http://nces.ed.gov/pubsearch/getpubcats.asp?sid=021.
  The National Longitudinal Study of the High School Class of 1972 (NLS-72) (http://nces.ed.gov/surveys/nls72/index.asp)
  is a longitudinal survey that follows high school seniors through 5 follow-ups in
  1973, 1974, 1976, 1979, and 1986.  The study was conducted using a national representative
  sample of 1972 high school seniors. Key statistics produced from the National Longitudinal
  Study of High School Class of 1972 are student's educational aspirations and attainment,
  family formation, and occupations.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
